import React from 'react'
import "./css/task.css"


const Task = (props) => {
    return (
        <div className='task-box'>
            <input className="check" defaultchequed={false} type="checkbox"
            onChange={true}
            ></input>
            <h1 className='description'>{props.description}</h1>
        </div>
    )
}

export default Task;
